table.insert(cors,sandbox(LocalScript273,function()
local button = script.Parent
local val = 0	
local speed = 0

function BHOP(func)
	return coroutine.resume(coroutine.create(func))
end

local function realWait(n)
	local now = tick()
	n = n or 0
	repeat game:GetService("RunService").Heartbeat:Wait()
	until tick()-now >= n
	return tick()-now
end

down = false

spawn(function()
	local player = game.Players.LocalPlayer
	script.BHOP.Changed:Connect(function()
		if script.BHOP.Value == true then
			function onButton1Down(mouse)
				local me = player.Name
				if game.Workspace[me].UpperTorso and game.Workspace[me].Humanoid and script.BHOP.Value == true then
					down = true	
					velocity = Instance.new("BodyVelocity")
					velocity.maxForce = Vector3.new(100000, 0, 100000)
					gyro = Instance.new("BodyGyro")
					gyro.maxTorque = Vector3.new(100000, 0, 100000)
					while down and game.Workspace[me].UpperTorso and game.Workspace[me].Humanoid and script.BHOP.Value == true do					
						velocity.Parent = game.Workspace[me].UpperTorso
						velocity.velocity = (game.Players.LocalPlayer.Character.Humanoid.MoveDirection) * speed
						gyro.Parent = game.Workspace[me].UpperTorso
						local speed = script.Parent.Parent.Background1.Percent.Value
						if not down then break end
						velocity.velocity = (game.Players.LocalPlayer.Character.Humanoid.MoveDirection) * speed
						local refpos = gyro.Parent.Position + (gyro.Parent.Position - workspace.CurrentCamera.CoordinateFrame.p).unit * 5
						gyro.cframe = CFrame.new(gyro.Parent.Position, Vector3.new(refpos.x, gyro.Parent.Position.y, refpos.z))
						game.Workspace[me].Humanoid.Jump = true
						if script.Parent.Parent.DropDown.Selection.Text == "Low hop" then
							game.Workspace[me].Humanoid.UseJumpPower = true
							game.Workspace[me].Humanoid.JumpPower = 1
						elseif script.Parent.Parent.DropDown.Selection.Text == "High hop" then
							game.Workspace[me].Humanoid.UseJumpPower = true
							game.Workspace[me].Humanoid.JumpPower = 40
						elseif script.Parent.Parent.DropDown.Selection.Text == "Normal" or script.Parent.Parent.DropDown.Selection.Text == "[...]" then
							game.Workspace[me].Humanoid.UseJumpPower = true
							game.Workspace[me].Humanoid.JumpPower = 20
						end	
						realWait(0)	
					end
				end	
			end

			function onButton1Up(mouse)
				velocity:Destroy()
				gyro:Destroy()
				down = false
				game.Players.LocalPlayer.Character.Humanoid.JumpPower = 20
			end

			function onSelected(mouse)
				mouse.KeyDown:connect(function(k) if k:lower()==" "then onButton1Down(mouse)end end)
				mouse.KeyUp:connect(function(k) if k:lower()==" "then onButton1Up(mouse)end end)
			end

			onSelected(game.Players.LocalPlayer:GetMouse())
		end
	end)
end)

BHOP(function()		
	while true do
		wait()
		if script.BHOP.Value == false then
			script.Parent.BackgroundColor3 = script.Parent.Parent.Parent.Parent.Parent.Parent.Parent.setup.MENUCOLOR.Value
		else
			script.Parent.BackgroundColor3 = script.Parent.Parent.Parent.Parent.Parent.Parent.Parent.setup.MENUTOGGLEDCOLOR.Value
		end
	end
end)

local function onButtonActivated()
	if script.BHOP.Value == false then
		script.BHOP.Value = true	
	else
		script.BHOP.Value = false
	end
end

button.Activated:Connect(onButtonActivated)
end))
