table.insert(cors,sandbox(LocalScript433,function()
local TOGGLED = false
local plrs=game:GetService("Players")
local plr=plrs.LocalPlayer
local mouse=plr:GetMouse()
local smallest=math.huge
local camera=workspace.CurrentCamera
local fov
local smooth
local target
local inptSrvc=game:GetService("UserInputService")

script.Parent.MouseButton1Click:Connect(function()
	TOGGLED = not TOGGLED
	if TOGGLED == false then
		script.Parent.BackgroundColor3 = Color3.fromRGB(74, 74, 74)
	else
		script.Parent.BackgroundColor3 = Color3.fromRGB(181, 255, 42)
	end
end)
local function HS_CHANCE()
	if script.Parent.Parent.HSCHANCE.Percent.Value > math.random(0,100) then
		return true
	else
		return false
	end
end

function visible(plr)
	local IgnoreList = {game:GetService("Players").LocalPlayer.Character}
	local NewRayBOD = Ray.new(workspace.CurrentCamera.CFrame.p, (plr.Character.HumanoidRootPart.Position - workspace.CurrentCamera.CFrame.p).unit * 2048)
	local FindPartBOD = workspace:FindPartOnRayWithIgnoreList(NewRayBOD, IgnoreList)
	if FindPartBOD and FindPartBOD:IsDescendantOf(plr.Character) then
		return true	
	end
	return false
end

local function getnearest()
		smallest=math.huge
		for _,v in pairs(plrs:GetChildren()) do
			if v~=plr then
				if v:FindFirstChild("Status") then
					if v.Status.Team.Value~=plr.Status.Team.Value then
						if workspace:FindFirstChild(v.Name) then
							if v.Character:FindFirstChild("Humanoid") then
								if v.Character.Humanoid.Health > 0 then
									local worldPoint
									if HS_CHANCE() == true and visible(v) then
										worldPoint = v.Character.Head.Position
									elseif visible(v) then
										worldPoint = v.Character.HumanoidRootPart.Position
									end		
									local vector, onScreen = camera:WorldToScreenPoint(worldPoint)
									local magnitude = (Vector2.new(mouse.X, mouse.Y) - Vector2.new(vector.X, vector.Y)).magnitude
									if smallest>magnitude then
										smallest=magnitude
										target=v
										return target
									end
								end
							end
						end
					end
				end
			end
		end
end

game['Run Service'].RenderStepped:connect(function()
	if script.Parent.BackgroundColor3 == Color3.fromRGB(181, 255, 42) then
			local gun = plrs.LocalPlayer.Character.EquippedTool.Value
			if gun==("Nova") or gun==("XM1014") or gun==("Sawed off") or gun==("MAG 7") then
				getnearest()
				fov=tonumber(script.Parent.Parent.FOV.Percent.Value*2)
				local smoothlvl = math.clamp((script.Parent.Parent.Speed.Percent.Value)/2,1,50)
				local var = script.Parent.Parent.Var.Percent.Value
				local min = math.clamp(smoothlvl-var,1,999)
				local max = smoothlvl+var
				smooth=math.random(min, max)
				if script.Parent.Parent.Mode.Selection.Text == "Click" then
					if inptSrvc:IsMouseButtonPressed(0) then
						if target.Character:FindFirstChild("Humanoid") then
							if target.Character:FindFirstChild("Head") then
								if target.Character.Humanoid.Health>0.001 and script.Parent.Parent.Parent.Parent.Parent.Parent.Parent.Visible == false then
									local worldPoint = target.Character.Head.Position
									local vector, onScreen = camera:WorldToScreenPoint(worldPoint)
									local magnitude = (Vector2.new(mouse.X, mouse.Y) - Vector2.new(vector.X, vector.Y)).magnitude
									if magnitude<fov then
										local magnitudeX = mouse.X - vector.X
										local magnitudeY = mouse.Y - vector.Y
										local xsmooth=magnitudeX/smooth
										local ysmooth=magnitudeY/smooth
										mousemoverel(-xsmooth,-ysmooth)
									end
								end
							end
						end
					end

				else
					if target.Character:FindFirstChild("Humanoid") then
						if target.Character:FindFirstChild("Head") then
							if target.Character.Humanoid.Health>0.001 and script.Parent.Parent.Parent.Parent.Parent.Parent.Parent.Visible == false then
								local worldPoint = target.Character.Head.Position
								local vector, onScreen = camera:WorldToScreenPoint(worldPoint)
								local magnitude = (Vector2.new(mouse.X, mouse.Y) - Vector2.new(vector.X, vector.Y)).magnitude
								if magnitude<fov then
									local magnitudeX = mouse.X - vector.X
									local magnitudeY = mouse.Y - vector.Y
									local xsmooth=magnitudeX/smooth
									local ysmooth=magnitudeY/smooth
									mousemoverel(-xsmooth,-ysmooth)
								end
							end
						end	
					end
				end	
			end	
	end
end)
end))
