				if game.Players.LocalPlayer.Character:FindFirstChild("Head") and game.Players.LocalPlayer.Character.Head.Transparency ~= 0 then
					game.Players.LocalPlayer.Character.Head.Transparency = 0
				end
			end)	
		end
